// --------------------------------------- Experience List
export const ExperienceList = [
    {
      img: "https://logowik.com/content/uploads/images/the-university-of-utah6232.logowik.com.webp",
      title: "Graduate Research Assistant",
      timeline: "May 2023 - Present",
      tech_stack: "AI, Deep Reinforcement Learning, Reinforcement Learning, Self Driving Cars",
      description: "I am currently involved in the field of Artificial Intelligence, performing longitudinal study of how people iterate on reward design by using amazon deep racer car environment. Additionally, I am developing AI tools that assist a user in reward design by applying ideas from Inverse Reward Design and active reward learning to cases where a human can write down reward functions.",
      website: "https://www.utah.edu/",
    //   demo_url: "https://your_project_demo_link",
    },
    {
        img: "https://logowik.com/content/uploads/images/the-university-of-utah6232.logowik.com.webp",
        title: "Graduate Teaching Assistant",
        timeline: "Aug 2022 - Apr 2023",
        tech_stack: "Software Engineering, Computer Programming, Data Structures and Algorithms",
        description: "I provided support to professors in teaching various courses such as Software Engineering, Computer Programming, and Data Structures and Algorithms. This involves preparing course materials, engaging with students during in-person classes, lab sessions, and online interactions to address their queries. I am also responsible for grading assignments and exams.",
        website: "https://www.utah.edu/",
      //   demo_url: "https://your_project_demo_link",
      },
      {
        img: "https://upload.wikimedia.org/wikipedia/commons/b/b1/Tata_Consultancy_Services_Logo.svg",
        title: "Data Scientist",
        timeline: "Aug 2020 - July 2022",
        description: "I was involved in the complete implementation of projects related to Customer Lifetime Value (CLV) modeling, Media Mix Modeling, and ROI analysis. The objective was to utilize Machine Learning techniques to develop econometric models that quantified marketing and pricing strategies for Wiley, an American multinational publishing company.",
        tech_stack: "Machine Learning, MLflow, Statistics",
        website: "https://www.tcs.com/",
        // demo_url: "https://your_project_demo_link",
      },
      {
        img: "https://upload.wikimedia.org/wikipedia/commons/b/b1/Tata_Consultancy_Services_Logo.svg",
        title: "Software Engineer",
        timeline: "Jul 2019 - Jul 2020",
        description: "I was involved in the end-to-end implementation of a Data Warehouse Migration Project for Western Union Financial Services Ltd. The project involved migrating data from the source system (Netezza) to the target system (Snowflake). My responsibilities encompassed gathering business requirements, conducting analysis, designing the solution, overseeing development, performing testing, migrating the code, implementing the solution, providing support, and documenting the entire process.",
        tech_stack: "Snowflake, Tableau, SQL, Python",
        website: "https://www.tcs.com/",
        // demo_url: "https://your_project_demo_link",
      },
  ];
